/**
 * @param {number[]} nums
 * @return {number}
 */
var minimumSum = function(nums) {
    let minLeft = Array(nums.length).fill(Infinity);
    let minRight = Array(nums.length).fill(Infinity);
    let minSum = Infinity;

    for (let i = 1, min = nums[0]; i < nums.length - 1; i++) {
        if (nums[i] > min) minLeft[i] = min;
        min = Math.min(min, nums[i]);
    }

    for (let i = nums.length - 2, min = nums[nums.length - 1]; i > 0; i--) {
        if (nums[i] > min) minRight[i] = min;
        min = Math.min(min, nums[i]);
    }

    for (let i = 1; i < nums.length - 1; i++) {
        if (minLeft[i] !== Infinity && minRight[i] !== Infinity) {
            minSum = Math.min(minSum, minLeft[i] + nums[i] + minRight[i]);
        }
    }

    return minSum === Infinity ? -1 : minSum;
};
